import React, { useState} from 'react';
import '../Navbar.css';
import { makeStyles } from '@material-ui/core/styles';
import {Typography} from '@material-ui/core';
import '../App.css';
import Card from 'react-bootstrap/Card'
import "bootstrap/dist/css/bootstrap.min.css";
import Square from '.././experiences/square.js'
import Canada from '.././experiences/canada.js'
import Pinterest from '.././experiences/pinterest.js'
import BVP from '.././experiences/bvp.js'
import Twitter from '.././experiences/twitter.js'
import Ontario18 from '.././experiences/ontario18.js'
import Ontario19 from '.././experiences/ontario19.js'
import styles from '../styles.js';
import Squares from ".././experiences/square.js";
import Canad from "../experiences/canada";
import Pins from "../experiences/pinterest";

const ColoredLine = ({ color }) => (
    <hr
        style={{
            color: "white"
        }}
    />
);

function ExperienceCard() {
    const classes = styles();

    return (

        <div className="App">
               
                <Card
                    bg={'dark'} text={'white'} className={classes.smallSpace}>
                    <Card.Body>
                        <Card.Title><b>Experience</b></Card.Title>


                        <Squares />
                        <ColoredLine />

                        <Canad />
                        <ColoredLine />

                        <Pins />
                        <ColoredLine />

                        <BVP />
                        <ColoredLine />

                        <Twitter />
                        <ColoredLine />

                        <Ontario18 />
                        <ColoredLine />

                        <Ontario19 />
                    </Card.Body>
                </Card>

                <div className={classes.largeSpace}>
                </div>

        </div>
    );
}

export default ExperienceCard;
